  \"Red Rock Lakes National Wildlife Refuge: Narrative report: January 1 to December
  31, 1965\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
